<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width,initial-scale=1,maximum-scale=1,user-scalable=yes">
<title>A Journey Made Just For You</title>
<link href="https://fonts.googleapis.com/css2?family=Cormorant+Garamond:ital,wght@0,300;0,400;0,500;0,600;1,300;1,400&family=DM+Sans:wght@300;400;500&family=Caveat:wght@400;500;600&display=swap" rel="stylesheet">
<style>
:root{--cr:#FDEEF2;--ro:#C27A8C;--dr:#8B2252;--go:#C9A96E;--tx:#3D2B2B;--tl:#9A8585;
--fh:'Cormorant Garamond',serif;--fb:'DM Sans',sans-serif;--fc:'Caveat',cursive}
*{box-sizing:border-box;margin:0;padding:0}
body{background:var(--cr);font-family:var(--fb);color:var(--tx);overflow-x:hidden}
::selection{background:rgba(194,122,140,.2)}
::-webkit-scrollbar{width:5px}::-webkit-scrollbar-track{background:0 0}::-webkit-scrollbar-thumb{background:rgba(201,169,110,.15);border-radius:3px}
input::placeholder{color:var(--tl);opacity:.3}
button{-webkit-tap-highlight-color:transparent}
img{max-width:100%}

/* Animations */
@keyframes fU{from{opacity:0;transform:translateY(20px)}to{opacity:1;transform:translateY(0)}}
@keyframes fI{from{opacity:0}to{opacity:1}}
@keyframes fO{from{opacity:1}to{opacity:0}}
@keyframes scI{from{opacity:0;transform:scale(.85)}to{opacity:1;transform:scale(1)}}
@keyframes shX{0%,100%{transform:translateX(0)}20%{transform:translateX(-10px)}60%{transform:translateX(8px)}}
@keyframes hR{0%{transform:translateY(0) rotate(0);opacity:0}10%{opacity:.9}100%{transform:translateY(-105vh) rotate(25deg);opacity:0}}
@keyframes flU{0%{transform:translateY(0);opacity:0}5%{opacity:.4}95%{opacity:.4}100%{transform:translateY(-110vh);opacity:0}}
@keyframes pls{0%,100%{transform:scale(1)}50%{transform:scale(1.04)}}
@keyframes ken{0%{transform:scale(1)}100%{transform:scale(1.08)}}
@keyframes slideL{from{opacity:0;transform:translateX(40px)}to{opacity:1;transform:translateX(0)}}
@keyframes slideR{from{opacity:0;transform:translateX(-40px)}to{opacity:1;transform:translateX(0)}}
@keyframes float{0%,100%{transform:translateY(0)}50%{transform:translateY(-8px)}}
@keyframes glow{0%,100%{box-shadow:0 0 20px rgba(201,169,110,.1)}50%{box-shadow:0 0 40px rgba(201,169,110,.25)}}

.fU{animation:fU .7s ease both}.fI{animation:fI .5s ease both}

/* Layout */
.wrap{max-width:640px;margin:0 auto;padding:28px 20px;position:relative;z-index:1}
.hearts-bg{position:fixed;inset:0;pointer-events:none;z-index:0;overflow:hidden}
.heart-f{position:absolute;bottom:-20px;color:rgba(194,122,140,.08)}

/* Hero image styles */
.hero-img{width:100%;border-radius:20px;overflow:hidden;box-shadow:0 16px 48px rgba(61,43,43,.12);position:relative}
.hero-img img{width:100%;display:block;animation:ken 20s ease alternate infinite}
.hero-img::after{content:'';position:absolute;inset:0;background:linear-gradient(180deg,transparent 60%,rgba(61,43,43,.06))}

/* Sprinkled images */
.spr{border-radius:16px;overflow:hidden;box-shadow:0 8px 32px rgba(61,43,43,.08);animation:fU .6s ease both}
.spr img{width:100%;display:block}
.spr-duo{display:grid;grid-template-columns:1fr 1fr;gap:10px;margin:32px 0}
.spr-duo .spr{aspect-ratio:3/4}
.spr-duo .spr img{width:100%;height:100%;object-fit:cover}
.spr-side{float:right;max-width:200px;margin:0 0 16px 20px;transform:rotate(2deg)}
.spr-side-l{float:left;max-width:200px;margin:0 20px 16px 0;transform:rotate(-2deg)}
.spr-full{margin:32px -10px;border-radius:24px;overflow:hidden;box-shadow:0 16px 48px rgba(61,43,43,.1)}
.spr-full img{width:100%;display:block}
.spr-circle{width:140px;height:140px;border-radius:50%;overflow:hidden;border:4px solid rgba(201,169,110,.25);box-shadow:0 8px 32px rgba(61,43,43,.1);margin:0 auto 24px}
.spr-circle img{width:100%;height:100%;object-fit:cover}

/* Atmospheric glow */
.glow{position:absolute;border-radius:50%;overflow:hidden;pointer-events:none;z-index:0}
.glow img{width:100%;height:100%;object-fit:cover}

/* Inputs */
.inp-row{display:flex;gap:10px}
.inp-f{flex:1;padding:16px 22px;border-radius:16px;border:2px solid rgba(201,169,110,.2);background:rgba(255,255,255,.7);font-family:var(--fb);font-size:15px;color:var(--tx);outline:0;transition:border-color .3s}
.inp-f:focus{border-color:rgba(201,169,110,.4)}
.inp-f.ok{border-color:rgba(120,180,120,.4);background:rgba(120,180,120,.04)}
.inp-b{padding:16px 28px;border-radius:16px;border:0;background:linear-gradient(135deg,var(--ro),var(--dr));color:#fff;font-family:var(--fh);font-size:15px;cursor:pointer;box-shadow:0 4px 20px rgba(139,34,82,.15);transition:transform .2s}
.inp-b:hover{transform:scale(1.02)}.inp-b:disabled{background:rgba(120,180,120,.15);box-shadow:none;cursor:default;transform:none}

/* Buttons */
.big-btn{padding:18px 56px;border-radius:50px;border:0;background:linear-gradient(135deg,var(--ro),var(--dr));color:#fff;font-family:var(--fh);font-size:17px;cursor:pointer;letter-spacing:2px;box-shadow:0 8px 40px rgba(139,34,82,.2);transition:transform .2s,box-shadow .2s}
.big-btn:hover{transform:translateY(-2px);box-shadow:0 12px 48px rgba(139,34,82,.3)}
.music-btn{position:fixed;bottom:20px;right:20px;z-index:999;width:48px;height:48px;border-radius:50%;border:1.5px solid rgba(201,169,110,.3);background:rgba(255,248,240,.9);backdrop-filter:blur(10px);display:flex;align-items:center;justify-content:center;cursor:pointer;font-size:18px;color:var(--dr);box-shadow:0 4px 24px rgba(61,43,43,.1);transition:transform .2s}
.music-btn:hover{transform:scale(1.1)}

/* Progress */
.prog{display:flex;align-items:center;gap:12px;margin-bottom:32px}
.prog-d{width:28px;height:28px;border-radius:50%;display:flex;align-items:center;justify-content:center;font-family:var(--fb);font-size:10px;font-weight:600;transition:all .5s}
.prog-l{flex:1;height:2px;border-radius:1px;transition:background .5s}

/* Encoded box */
.enc{background:rgba(0,0,0,.025);border-radius:16px;padding:20px 18px;border:1px solid rgba(201,169,110,.1);margin-bottom:20px;font-family:'Courier New',monospace;font-size:13px;line-height:1.8;word-break:break-all;overflow-wrap:break-word}
.enc-l{font-family:var(--fb);font-size:10px;letter-spacing:2px;color:var(--go);margin-bottom:8px;text-transform:uppercase}

/* Blanks */
.bl{background:rgba(255,255,255,.4);border-radius:14px;padding:16px 18px;border:1.5px solid rgba(201,169,110,.12);transition:all .3s}
.bl.done{background:rgba(120,180,120,.04);border-color:rgba(120,180,120,.25)}

/* Pills & dots */
.pill{padding:6px 14px;border-radius:20px;font-size:10px;letter-spacing:1px;font-family:var(--fb);transition:all .3s}
.ddot{width:42px;height:42px;border-radius:12px;display:flex;align-items:center;justify-content:center;font-family:var(--fh);font-size:18px;transition:all .4s}
.lbox{width:44px;height:50px;border-radius:12px;border:2px solid rgba(201,169,110,.2);background:rgba(255,255,255,.4);display:inline-flex;align-items:center;justify-content:center;font-family:var(--fh);font-size:24px;color:var(--dr)}

/* Riddle */
.rbox{border-radius:20px;padding:28px 24px;margin-bottom:24px}

/* Overlays */
.ov{position:fixed;inset:0;z-index:1000;display:flex;align-items:center;justify-content:center;background:rgba(255,248,240,.94);backdrop-filter:blur(24px)}
.ov-h{position:absolute;bottom:-40px;opacity:0}
.pw-ov{position:fixed;inset:0;z-index:2000;display:flex;align-items:center;justify-content:center;background:rgba(61,43,43,.45);backdrop-filter:blur(14px)}
.pw-b{background:var(--cr);border-radius:24px;padding:36px 28px;max-width:360px;width:90%;text-align:center;box-shadow:0 20px 60px rgba(61,43,43,.2)}

/* Wrong message */
.wmsg{padding:10px 16px;border-radius:12px;margin-bottom:10px;background:rgba(200,100,100,.06);border:1px solid rgba(200,100,100,.15);color:#a05555;font-family:var(--fc);font-size:15px;text-align:center}

/* Hints */
.hrev{background:rgba(201,169,110,.06);border:1px solid rgba(201,169,110,.18);border-radius:14px;padding:16px 20px;font-family:var(--fc);font-size:16px;color:var(--go);line-height:1.6}
.hbtn{width:100%;padding:14px 20px;border-radius:14px;text-align:left;border:1px solid rgba(201,169,110,.18);background:rgba(201,169,110,.04);color:var(--go);font-family:var(--fb);font-size:13px;cursor:pointer;display:flex;align-items:center;gap:8px;transition:background .2s}
.hbtn:hover{background:rgba(201,169,110,.08)}.hbtn:disabled{opacity:.4;cursor:not-allowed;border-color:rgba(0,0,0,.04);background:rgba(0,0,0,.01);color:var(--tl)}

/* Certificate */
.cert{background:linear-gradient(160deg,rgba(255,248,240,.9),rgba(201,169,110,.08));border-radius:24px;padding:52px 36px;border:2px solid rgba(201,169,110,.25);text-align:center;position:relative;overflow:hidden;box-shadow:0 16px 48px rgba(201,169,110,.12)}
.cert-in{position:absolute;inset:14px;border:1px solid rgba(201,169,110,.15);border-radius:16px;pointer-events:none}

/* Photo grid */
.pgrid{display:grid;grid-template-columns:repeat(3,1fr);gap:8px}
.pgrid>div{border-radius:16px;overflow:hidden}
.pgrid img{width:100%;height:100%;object-fit:cover;display:block}

/* Section divider */
.divider{width:60px;height:2px;background:linear-gradient(90deg,transparent,var(--go),transparent);margin:40px auto;border-radius:1px}
</style>
</head>
